export default ({ img, title }) => {
  return (
    <div className='w-30/31'>
      <div className='xl:flex xl:flex-wrap xl:items-center xl:justify-start xl:shadow-md rounded-xl bg-white'>
        <img
          src={img}
          className='h-20 md:h-full xl:h-20 rounded-b-none xl:h-full xl:w-32 rounded-lg xl:rounded-xl xl:rounded-r-none'
          alt='explore1'
        />
        <p class='text-sm py-3 xl:py-0 pl-4 text-gray-750 font-semibold'>
          {title}
        </p>
      </div>
    </div>
  );
};
